import React from "react";
import { GoogleLogin } from 'react-google-login';
import { GoogleOAuthProvider } from '@react-0auth/google';

const G = () => {
    const responseGoogle = (response) => {
        console.log(response);
    };

    return (
        <div
            style={{
                display: 'flex',
                flex: '1',
                height: '100vh',
                justifyContent: 'center',
                alignItems: 'center',
                backgroundColor: 'red'
            }}>
            Hi My name is Phuong
            <GoogleOAuthProvider clientId="AIzaSyDLPU9_ETkbM6xpnvSrWRPKJen3KFfRYO8">
                <GoogleLogin
                    clientId="927735981929-jnm5blcvu44qrhvgeujcd5d2imkmf4gq.apps.googleusercontent.com"
                    render={renderProps => (
                        <button onClick={renderProps.onClick} disabled={renderProps.disabled}>This is my custom Google button</button>
                    )}
                    buttonText="Login"
                    onSuccess={responseGoogle}
                    onFailure={responseGoogle}
                    cookiePolicy={'single_host_origin'}
                />
            </GoogleOAuthProvider>
        </div>
    );
}

export default G;
